import React from "react";

const RaceVotes = ({ race, votes }) => {
  console.log("RaceVotes.jsx", race, votes);
  const voteCountMap = new Map();

  [
    race.racePersonOneName,
    race.racePersonTwoName,
    race.racePersonThreeName,
  ].forEach((person) => {
    voteCountMap.set(person, 0);
  });

  votes.forEach((vote) => {
    if (vote.raceID === race.raceID) {
      const person = vote.votePerson;
      voteCountMap.set(person, voteCountMap.get(person) + 1);
    }
  });

  return (
    <div>
      <h1>Race Votes</h1>
      <div>
        {Array.from(voteCountMap.keys()).map((person) => (
          <p key={person}>
            {person}: {voteCountMap.get(person)}
          </p>
        ))}
      </div>
    </div>
  );
};

export default RaceVotes;
